import React from "react";
import Listcards from "./listcards";
import { robots } from "./robots";
import Searchbox from "./searchbox";

const App = () => {
  return (
    <div >
      <h1>RoboFriends</h1>
      <Searchbox />
      <Listcards robots={robots} />
    </div>
  );
};

export default App;
